import React, { Component } from 'react';
import Button from "@material-ui/core/Button";
import { Link } from "react-router-dom"

class PostComplete extends Component {

    render() {

        //const post = posts.id[this.props.id]
        var post = this.props.post
        return (
            <div>
                <h2>{post.title}</h2>
                <p>{post.Topic}</p>
                
                <Link to ='/Foro'>
                    <Button m={2}
                        size="large"
                        color="primary"
                        variant="contained"
                        >Regresar</Button>
                </Link>
            </div>
        )



    }
}

export default PostComplete;
